{
  "openapi":"3.0.2",
  "info":{
    "title":"FastAPI",
    "version":"0.1.0"
  },
  "servers":[
    {
      "url":"/public"
    }
  ],
  "paths":{
    "/v2/builds/{build_source}/{build_id}/":{
      "get":{
        "tags":["builds"],
        "summary":"Get Build",
        "operationId":"get_build_v2_builds__build_source___build_id___get",
        "parameters":[
          {
            "required":true,
            "schema":{
              "title":"Build Source",
              "enum":["vdc","rdc"],
              "type":"string"
            },
            "name":"build_source",
            "in":"path"
        },
        {
          "required":true,
          "schema":{
            "title":"Build Id",
            "type":"string"
          },
          "name":"build_id",
          "in":"path"
        }
      ],
      "responses":{
        "200":{
          "description":"Successful Response",
          "content":{
            "application/json":{
              "schema":{"$ref":"#/components/schemas/BuildV2"}
              }
            }
          },
          "422":{
            "description":"Validation Error",
            "content":{
              "application/json":{
                "schema":{"$ref":"#/components/schemas/HTTPValidationError"}
                }
              }
            }
          }
        }
      },
    "/v2/builds/{build_source}/":{
        "get":{
          "tags":["builds"],
          "summary":"Get Builds",
          "operationId":"get_builds_v2_builds__build_source___get",
          "parameters":[
            {
              "required":true,
              "schema":{
                "title":"Build Source",
                "enum":["vdc","rdc"],
                "type":"string"
              },
              "name":"build_source",
              "in":"path"
            },
            {
              "required":false,
              "schema":{
                "title":"User Id",
                "type":"string"
              },
              "name":"user_id",
              "in":"query"
            },
            {
              "required":false,
              "schema":{
                "title":"Org Id",
                "type":"string"
              },
              "name":"org_id",
              "in":"query"
            },
            {
              "required":false,
              "schema":{
                "title":"Group Id",
                "type":"string"
              },
              "name":"group_id",
              "in":"query"
            },
            {
              "required":false,
              "schema":{
                "title":"Team Id",
                "type":"string"
              },
              "name":"team_id",
              "in":"query"
            },
            {
              "required":false,
              "schema":{
                "title":"Status",
                "type":"array",
                "items":{
                  "enum":[
                    "success",
                    "failed",
                    "complete",
                    "error",
                    "running"
                  ],
                  "type":"string"
                }
              },
              "name":"status",
              "in":"query"
            },
            {
              "required":false,
              "schema":{
                "title":"Start",
                "type":"integer"
              },
              "name":"start",
              "in":"query"
            },
            {
              "required":false,
              "schema":{
                "title":"End",
                "type":"integer"
              },
              "name":"end",
              "in":"query"
            },
            {
              "required":false,
              "schema":{
                "title":"Limit",
                "type":"integer",
                "default":50
              },
              "name":"limit",
              "in":"query"
            },
            {
              "required":false,
              "schema":{
                "title":"Offset",
                "type":"integer",
                "default":0
              },
              "name":"offset",
              "in":"query"
            },
            {
              "required":false,
              "schema":{
                "title":"Sort",
                "enum":[
                  "asc",
                  "desc"
                ],
                "type":"string",
                "default":"desc"
              },
              "name":"sort",
              "in":"query"
            }
          ],
          "responses":{
            "200":{
              "description":"Successful Response",
              "content":{
                "application/json":{
                  "schema":{"$ref":"#/components/schemas/BuildsV2Response"}
                }
              }
            },
            "422":{
              "description":"Validation Error",
              "content":{
                "application/json":{
                  "schema":{"$ref":"#/components/schemas/HTTPValidationError"}
                }
              }
            }
          }
        }
      },
    "/v2/builds/{build_source}/jobs/{job_id}/build/":{
        "get":{
          "tags":["builds"],
          "summary":"Get Build By Job Id",
          "operationId":"get_build_by_job_id_v2_builds__build_source__jobs__job_id__build__get",
          "parameters":[
            {
              "required":true,
              "schema":{
                "title":"Build Source",
                "enum":["vdc","rdc"],
                "type":"string"
              },
              "name":"build_source",
              "in":"path"
            },
            {
              "required":true,
              "schema":{
                "title":"Job Id",
                "type":"string"
              },
              "name":"job_id",
              "in":"path"
            }
          ],
          "responses":{
            "200":{
              "description":"Successful Response",
              "content":{
                "application/json":{
                  "schema":{"$ref":"#/components/schemas/BuildV2"}
                }
              }
            },
            "422":{
              "description":"Validation Error",
              "content":{
                "application/json":{
                  "schema":{"$ref":"#/components/schemas/HTTPValidationError"}
                }
              }
            }
          }
        }
      },
    "/v2/builds/{build_source}/{build_id}/jobs/":{
        "get":{
          "tags":["jobs"],
          "summary":"Get Jobs For Build",
          "operationId":"get_jobs_for_build_v2_builds__build_source___build_id__jobs__get",
          "parameters":[
            {
              "required":true,
              "schema":{
                "title":"Build Source",
                "enum":["vdc","rdc"],
                "type":"string"
              },
              "name":"build_source",
              "in":"path"
            },
            {
              "required":true,
              "schema":{
                "title":"Build Id",
                "type":"string"
              },
              "name":"build_id",
              "in":"path"
            },
            {
              "required":false,
              "schema":{
                "title":"Modified Since",
                "type":"string",
                "format":"date-time"
              },
              "name":"modified_since",
              "in":"query"
            },
            {
              "required":false,
              "schema":{
                "title":"Completed",
                "type":"boolean"
              },
              "name":"completed",
              "in":"query"
            },
            {
              "required":false,
              "schema":{
                "title":"Errored",
                "type":"boolean"
              },
              "name":"errored",
              "in":"query"
            },
            {
              "required":false,
              "schema":{
                "title":"Failed",
                "type":"boolean"
              },
              "name":"failed",
              "in":"query"
            },
            {
              "required":false,
              "schema":{
                "title":"Finished",
                "type":"boolean"
              },
              "name":"finished",
              "in":"query"
            },
            {
              "required":false,
              "schema":{
                "title":"New",
                "type":"boolean"
              },
              "name":"new",
              "in":"query"
            },
            {
              "required":false,
              "schema":{
                "title":"Passed",
                "type":"boolean"
              },
              "name":"passed",
              "in":"query"
            },
            {
              "required":false,
              "schema":{
                "title":"Public",
                "type":"boolean"
              },
              "name":"public",
              "in":"query"
            },
            {
              "required":false,"
              schema":{
                "title":"Queued",
                "type":"boolean"
              },
              "name":"queued",
              "in":"query"
            },
            {
              "required":false,
              "schema":{
                "title":"Running",
                "type":"boolean"
              },
              "name":"running",
              "in":"query"
            },
            {
              "required":false,
              "schema":{
                "title":"Faulty",
                "type":"boolean"
              },
              "name":"faulty",
              "in":"query"
            }
          ],
          "responses":{
            "200":{
              "description":"Successful Response",
              "content":{
                "application/json":{
                  "schema":{"$ref":"#/components/schemas/JobsV2Response"}
                }
              }
            },
            "422":{
              "description":"Validation Error",
              "content":{
                "application/json":{
                  "schema":{"$ref":"#/components/schemas/HTTPValidationError"}
                }
              }
            }
          }
        }
      }
  },
  "components":{
      "schemas":{
        "BuildV2":{
          "title":"BuildV2",
          "required":[
            "creation_time",
            "id",
            "jobs",
            "modification_time",
            "name",
            "owner_id",
            "public","run"
          ],
          "type":"object",
          "properties":{
            "creation_time":{
              "title":"Creation Time",
              "type":"integer"
            },
            "deletion_time":{
              "title":"Deletion Time",
              "type":"integer"
            },
            "end_time":{
              "title":"End Time",
              "type":"integer"
            },
            "group_id":{
              "title":"Group Id",
              "type":"string"
            },
            "id":{
              "title":"Id",
              "type":"string"},
              "jobs":{"$ref":"#/components/schemas/JobCounters"},
              "modification_time":{
                "title":"Modification Time",
                "type":"integer"
              },
              "name":{
                "title":"Name",
                "type":"string"
              },
              "org_id":{
                "title":"Org Id",
                "type":"string"
              },
              "owner_id":{
                "title":"Owner Id",
                "type":"string"
              },
              "passed":{
                "title":"Passed",
                "type":"boolean"
              },
              "public":{
                "title":"Public",
                "type":"boolean"
              },
              "run":{
                "title":"Run",
                "type":"integer"
              },
              "start_time":{
                "title":"Start Time",
                "type":"integer"
              },
              "status":{
                "title":"Status",
                "enum":["success","failed","complete","error","running"],
                "type":"string"
              },
              "team_id":{
                "title":"Team Id",
                "type":"string"
              }
            },
            "additionalProperties":false
          },
          "BuildsV2Response":{
            "title":"BuildsV2Response",
            "required":["builds"],
            "type":"object",
            "properties":{
              "builds":{
                "title":"Builds",
                "type":"array",
                "items":{"$ref":"#/components/schemas/BuildV2"}
              }
            },
            "additionalProperties":false
          },
          "HTTPValidationError":{
            "title":"HTTPValidationError",
            "type":"object",
            "properties":{
              "detail":{
                "title":"Detail",
                "type":"array",
                "items":{"$ref":"#/components/schemas/ValidationError"}
              }
            }
          },
          "JobCounters":{
            "title":"JobCounters",
            "type":"object",
            "properties":{
              "completed":{
                "title":"Completed",
                "type":"integer",
                "default":0
              },
              "errored":{
                "title":"Errored",
                "type":"integer",
                "default":0
              },
              "failed":{
                "title":"Failed",
                "type":"integer",
                "default":0
              },
              "finished":{
                "title":"Finished",
                "type":"integer",
                "default":0
              },
              "passed":{
                "title":"Passed",
                "type":"integer",
                "default":0
              },
              "public":{
                "title":"Public",
                "type":"integer",
                "default":0
              },
              "queued":{
                "title":"Queued",
                "type":"integer",
                "default":0
              },
              "running":{
                "title":"Running",
                "type":"integer",
                "default":0
              }
            },
            "additionalProperties":false
          },
          "JobState":{
            "title":"JobState",
            "required":["completed","errored","failed","finished","new","passed","public","queued","running"],
            "type":"object",
            "properties":{
              "completed":{
                "title":"Completed",
                "type":"boolean"
              },
              "errored":{
                "title":"Errored",
                "type":"boolean"
              },
              "failed":{
                "title":"Failed",
                "type":"boolean"
              },
              "finished":{
                "title":"Finished",
                "type":"boolean"
              },
              "new":{
                "title":"New",
                "type":"boolean"
              },
              "passed":{
                "title":"Passed",
                "type":"boolean"
              },
              "public":{
                "title":"Public",
                "type":"boolean"
              },
              "queued":{
                "title":"Queued",
                "type":"boolean"
              },
              "running":{
                "title":"Running",
                "type":"boolean"
              }
            },
            "additionalProperties":false},
            "JobV2":{
              "title":"JobV2",
              "required":["creation_time","id","modification_time","state"],
              "type":"object",
              "properties":{
                "creation_time":{
                  "title":"Creation Time",
                  "type":"integer"
                },
                "deletion_time":{
                  "title":"Deletion Time",
                  "type":"integer"
                },
                "id":{
                  "title":"Id",
                  "type":"string"
                },
                "modification_time":{
                  "title":"Modification Time",
                  "type":"integer"
                },
                "state":{"$ref":"#/components/schemas/JobState"}
              },
              "additionalProperties":false
            },
            "JobsV2Response":{
              "title":"JobsV2Response",
              "required":["jobs"],
              "type":"object",
              "properties":{
                "jobs":{
                  "title":"Jobs",
                  "type":"array",
                  "items":{"$ref":"#/components/schemas/JobV2"}
                }
              },
              "additionalProperties":false
            },
            "ValidationError":{
              "title":"ValidationError",
              "required":["loc","msg","type"],
              "type":"object",
              "properties":{
                "loc":{
                  "title":"Location",
                  "type":"array",
                  "items":{"type":"string"}
                },
                "msg":{
                  "title":"Message",
                  "type":"string"
                },
                "type":{
                  "title":"Error Type",
                  "type":"string"}
                }
              }
            }
          },
  "tags":[
    {
      "name":"builds",
      "description":"Builds are grouping multiple jobs and additionally provide job counts"
    }
  ]
  }
